	(53, 'FOOTER_RISK_LOSS', 'BUTTON', '["0"]', 'There is a risk of loss in trading foreign currencies and it is not suitable for everyone. We are compensated for our services through the bid-ask spread.', 'Existe riesgo en el intercambio de divisas extranjeras y no es asequible para cualquier persona. Nuestros servicios son compensados a través de la diferencia entre la oferta y la demanda.', NULL, '外汇交易有亏损的风险因此并不适合所有人。我们的收入来自交易的买卖点差。', 'تجارة العملات الأجنبية تنطوي على مخاطرة وقد لا تكون مناسبة لجميع الأشخاص. نحن نحصل على عائد في مقابل خدماتنا من خلال الفرق بين أسعار السؤال والعطاء(الاسبريد).', 'Существует риск в торговле иностранной валютой и не является доступным для всех. Наши услуги компенсируются за счет разницы между спросом и предложением', 'La negoziazione di valute estere comporta dei rischi e non è adatto a tutti. Siamo compensati per i nostri servizi attraverso la diffusione bid-ask. ', '외환/주식투자는 상당한 리스크를 동반하며, 모두에게 적합한 투자방법이 아닐 수도 있습니다. 위험고지 전문 (Risk Disclosure)을 참고하시기 바라며 자세한 사항은 <a class="text-white" href="mailto:korean@tradeviewforex.com">korean@tradeviewforex.com</a> 으로 문의해 주시기 바랍니다.', 'विदेशी मुद्राओं के कारोबार में नुकसान का जोखिम है और यह सभी के लिए उपयुक्त नहीं है। हमें बीड़ -अस्क स्प्रेड्स के माध्यम से हमारी सेवाओं के लिए मुआवजा दिया जाता है।', 'Existe um risco de perda na negociação de moedas estrangeiras e não é adequado para todos. Somos compensados ​​por nossos serviços através do spread bid-ask. ', '2019-01-02 10:48:55', '2019-01-02 10:48:56'),
