	(55, 'FOOTER_RISK_RIGHTS', 'BUTTON', '["0"]', 'All rights reserved.', 'Todos los derechos reservados.', NULL, NULL, ' جميع الحقوق محفوظة.', 'Все права защищены. ', 'Tutti i diritti riservati. ', NULL, 'सभी अधिकार सुरक्षित ', 'Todos os direitos reservados. ', '2019-01-02 10:49:01', '2019-01-02 10:49:03'),
	(56, 'FOOTER_RISK_TERMS', 'BUTTON', '["0"]', 'The services and products offered by Tradeview LTD. are not being offered within the United States (US) and not being offered to US Persons, as defined under US law. The information on this website is not directed to residents of any country where FX and/or CFDs trading is restricted or prohibited by local laws or regulations. Tradeview is a fully registered Broker/Dealer under the regulations of the Cayman Island Monetary Authority. By clicking the Continue button, you agree to the terms and conditions.', 'Los servicios y productos ofrecidos por Tradeview Ltd. no están disponibles dentro de los Estados Unidos (EE.UU.) y tampoco se ofrecen a personas de Estados Unidos, según se define bajo la ley de EE.UU. Como tal, si usted es ciudadano o reside en cualquiera de estos países, cualquier mensaje de correo electrónico recibido no tiene la intención de servir como una invitación o inducción a nombre de cualquiera de las entidades antes mencionadas. Todas las oficinas ubicadas dentro de Canadá son oficinas administrativas solamente. Tradeview es un corredor/ distribuidor completamente registrado bajo las regulaciones de la Autoridad Monetaria de las Islas Caimán.', '本ウェブサイトは米国及び金融商品取引が国内法や規制により制限された国の居住者を対象としておらず、弊社はその法的管轄下の地域の方にサービスへの勧誘と考えられる業務を行う事はございません <br>\r\nThe services and products offered by Tradeview Ltd. are not being offered within the United States (US) and not being offered to US Persons, as defined under US law. As such, should you reside in or be a citizen of such a country, any email message received is not intended to serve as a solicitation or inducement on behalf of any of the aforementioned entities. Tradeview is a fully registered Broker/Dealer under the regulations of the Cayman Island Monetary Authority. TVCM Limited is a registered England and Wales company located at 15 Bromet Close, Watford, Hertfordshire WD17 4LP, United Kingdom, a wholly owned subsidiary of Tradeview Ltd. ', 'Tradeview所提供的服务不在美国