	(124, 'HOME_ILC_FEATURE_6', 'TEXT', '["1", "1001", "2001", "3001", "4001", "5001", "6001", "7001", "8001", "9001"]', 'No Dealing Desk, <strong>No Requotes,</strong> No Trading Restrictions', 'Sin mesa de cambio, <strong>Sin re-cotizaciones,</strong> Sin restricciones', NULL, NULL, 'لا مكتب التعامل, لا إعادة تسعير, لا قيود التداول', 'Без посредников при обмене, реквот и ограничений', 'NO DEALING DESK /NO REQUOTE NESSUN LIMITAZIONE AL TRADING', NULL, 'कोई डीलिंग डेस्क नहीं , कोई रिक्वेस्ट नहीं,\r\nकोई ट्रेडिंग प्रतिबंध नहीं', NULL, '2019-01-02 10:58:25', '2019-01-02 10:58:26'),
	(125, 'HOME_ILC_END_TEXT', 'TEXT', '["1", "1001", "2001", "3001", "4001", "5001", "6001", "7001", "8001", "9001"]', 'Enjoy Tradeview’s quality trade executions, personalized customer service, and the flexibility of the most outstanding platforms in the market. Tradeview offers MT4, MT5, cTrader and Currenex platforms to traders interested in speculating in the forex markets.', 'Tradeview Ltd. es una organización de corretaje en línea de clase mundial, enfocada en agregar constantemente nuevos fans añadiendo así más valor a nuestros productos y ofertas que los demás. Nuestra misión es simple y sencilla pero excepcionalmente poderosa - no nos olvidamos de nuestros Traders, ellos son nuestros clientes.', 'Tradeviewは常に最先端を求めるトレーダーにハイスペックな取引環境をご提供しています。業界最狭のスプレッド、卓越した約定力、日系人スタッフによる丁寧なサポートなど、トレーダーの皆様の気持ちを一番に理解することでTradeviewはオンライントレードに劇的な変化をもたらします。\r\nまずは無料デモ口座をお試しいただき、ご不明な点がございましたらお気軽にお問い合わせください。', 'Tradeview 为追求先端的交易者提供同行业里最小的点差和全天候的客服支持。在我们平台开户，您将极大地减少交易成本。我们的点差优势覆盖所有的外汇，贵金属和CFD产品。现在就开设模拟帐户体验吧！\r\n', 'تريدفيو الرائدة في صناعة وساطة التداول من الطراز العالمي تركز على خلق المشجعين عن طريق إضافة المزيد من القيمة باستمرار, في عروض المنتجات لدينا عن أي شخص آخر. مهمتنا هي بسيطة ومباشرة إلى الأمام لكنها قوية بشكل استثنائي - علينا ألا ننسى أبدا المتداولون لدينا هم عملائنا.', NULL, 'Tradeview è una società di trading online di fama mondiale, impegnata nella costante creazione di valore aggiunto prodotti La nostra missione è semplice e diretta: Noi non dimenticiamo mai che i nostri trader sono nostri clienti. ', '트레이드뷰는 전세계의 투자자들에게 최고의 온라인 트레이딩 솔루션을 제공하고자 2004년에 설립되었습니다. 트레이드뷰는 항상 최고의 테크놀로지를 고집하며, 전문적인 1:1 고객지원을 지원합니다. 트레이드뷰 데모계정을 시작해 보세요.', 'ट्रेडिव्यू लिमिटेड एक विश्व स्तरीय ऑनलाइन ट्रेडिंग ब्रोकरेज संगठन है, जो किसी और के अलावा हमारे उत्पाद प्रसाद में अधिक मूल्य जोड़कर सड़ांध प्रशंसकों को लगातार विकसित करने पर केंद्रित है। हमारा मिशन सरल और सीधे आगे अभी तक असाधारण शक्तिशाली है - हम कभी भी नहीं भूलते हैं कि हमारे व्यापारियों हमारे ग्राहकों हैं', 'Tradeview Ltd é uma Corretora de Negociação das Melhores a nível Mundial, focados em fidelizar clientes constantemente, através de produtos com condições únicas no Mercado. A nossa missão é simples e direta, ainda que excecionalmente poderosa. Nunca nos esquecemos que os nossos Traders são os nossos Clientes.\r\n', '2019-01-02 10:58:25', '2019-01-02 10:58:26'),
