	(400, 'SOFTWARE_HOME_INTRO', 'TEXT', '["4", "1004", "2004", "3004", "4004", "5004", "6004", "7004", "8004", "9004"]', 'Our state-of-the-art trading platforms are designed for active traders looking for an edge. Tradeview Forex offers a front-end trading system with complete back office support and a dealing center. Tradeview\'s Metatrader 4 trading platform is complete turnkey solution for online trading.<br><br><strong>Sophisticated ECN trading style platforms in the market.</strong>', 'Nuestras modernas plataformas fueron diseñadas por traders activos en búsqueda de una ventaja. Tradeview Forex ofrece a un sistema de trading con un back office completo, soporte y centro de negocios. La plataforma MetaTrader 4 de Tradeview representan una solución completa para realizar transacciones en Forex online. ', 'トレードビューは常に最先端を求めるトレーダーにハイスペックな取引環境をご提供しています。業界最狭のスプレッド、卓越した約定力、日本人スタッフによる丁寧なサポートなど、トレーダーの皆様の気持ちを一番に理解することでTradeviewはオンライントレードに劇的な変化をもたらします。<br><br><strong>無料デモ口座を是非お試しください</strong>', '多种不同的平台为交易者提供更多更灵活的选择。Tradeview的MetaTrader4, cTader和Currenex交易平台是在线交易的完美解决方案。', 'منصات التداول المتطورة التي نوفرها تم تصميمها خصيصا للمتداولين النشطين الباحثين دوما عن التميز. توفر ترايدفيونظام متطور لتنفيذ التداولات مع دعم كامل من قبل المكتب الخلفي ومركز التعاملات. منصات التداول ميتاتريدر4 و التي توفرها ترايدفيوتعتبر حلولا كاملة لممارسة التجارة عبر الانترنيت', NULL, 'Le nostre piattaforme sono progettate per operatori attivi in cerca di una controparte. Tradeview Forex offre offre un sistema di scambio di front-end con il supporto di back office completo. La piattaforma di trading <strong>Metatrader 4 di Tradeview è la soluzione completa chiavi in mano per il trading online con modalità di esecuzione ECN</strong>', NULL, NULL, 'Nossas plataformas de negociação de última geração são projetadas para Traders ativos que procuram vantagem em relação ao mercado.<strong>As melhores plataformas de trading </strong>', '2019-01-24 14:41:02', '2019-01-24 14:41:08'),
	(401, 'SOFTWARE_HOME_MT4_DESCRIPTION', 'TEXT', '["4", "1004", "2004", "4004", "5004", "6004", "7004", "8004", "9004"]', 'This free trading platform with quick execution, <br>market information and account management.', 'Esta plataforma gratuita, ofrece rápida ejecución,<br>información del mercado y administración de cuentas.', '世界で最も人気の取引システム<strong>MT4</strong>は抜群の約定力<br>と操作性を誇り、自動売買プログラムにも対応', '', '"هذه المنصه مجانيه وسريعه التنفيذ <br>معلومات السوق و اداره الحساب"', NULL, 'Una piattaforma con un esecuzione rapida,<br> informazioni di mercato e gestione di diversi account.', NULL, NULL, 'Esta plataforma de trading gratuita com execução rápida, <br>informações de mercado e gerenciamento de contas.', '2019-01-24 14:41:02', '2019-01-24 14:41:08'),
	(402, 'SOFTWARE_HOME_MT5_DESCRIPTION', 'TEXT', '["4", "1004", "2004", "4004", "5004", "6004", "7004", "8004", "9004"]', 'A powerful platform for Forex and exchange markets', 'Una plataforma poderosa para mercados e intercambios de divisas', 'Tradeviewの世界最高基準のトレード環境と<br>\r\nILCテクノロジーをMT5でご提供', NULL, 'ميتاتريدر 5 هى منصة قوية لأسواق الفوركس وتبادل العملات', NULL, 'Una piattaforma ottima per il Forex e il mercato azionario', NULL, NULL, 'Uma plataforma poderosa para mercados de Forex e de câmbio', '2019-01-24 14:41:02', '2019-01-24 14:41:08'),
	(403, 'SOFTWARE_HOME_CTRADER_DESCRIPTION', 'TEXT', '["4", "1004", "2004", "4004", "5004", "6004", "7004", "8004", "9004"]', 'Tradeview’s cTrader is one of the most sophisticated<br>\r\nECN trading style platforms in the market.', 'cTrader de Tradeview es una de las plataformas más<br>\r\nsofisticadas de tipo ECN en el mercado.', 'モバイル対応、多言語対応で世界中で愛用されている<br>\r\nCトレーダーを業界最小コストでご提供', NULL, 'منصه التداول CTrader التابعه لشركه تريد فيو <br>\r\nمن اكثر المنصات تطورا في اسلوب التداول في السوق', NULL, 'cTrader di Tradeview è uno delle più sofisticate <br>piattaforme di trading con esecuzione ECN del mercato.', NULL, NULL, 'O cTrader da Tradeview é uma das mais sofisticadas <br>plataformas de trading ECN no mercado.', '2019-01-24 14:41:02', '2019-01-24 14:41:08'),
	(404, 'SOFTWARE_HOME_CURRENEX_DESCRIPTION', 'TEXT', '["4", "1004", "2004", "4004", "5004", "6004", "7004", "8004", "9004"]', 'A bulletproof Forex <br>Platform for Individual Traders.', 'La mejor plataforma Forex para<br>\r\nComerciantes Individuales.', 'カリネックス社のテクノロジーを結集し、<br>\r\n裁量取引に特化されたFX 取引プラットフォーム', NULL, '"درع الفوركس <br>\r\nمنصه للمتداولين الفرديين "', NULL, 'La piattaforma corazzata per i trader.', NULL, NULL, 'Uma plataforma de Forex à prova <br>de bala para traders individuais.', '2019-01-24 14:41:02', '2019-01-24 14:41:08'),
	(405, 'SOFTWARE_MT4_BENEFITS_ITEM1_TITLE', 'TEXT', '["6", "200", "1006", "2006", "4006", "5006", "6006", "7006", "8006", "9006"]', 'Expert Advisor', 'Asesor Experto', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 17:16:23', '2019-02-01 17:16:28'),
	(406, 'SOFTWARE_MT4_BENEFITS_ITEM1_TEXT', 'TEXT', '["6", "200", "1006", "2006", "4006", "5006", "6006", "7006", "8006", "9006"]', 'Within MT4 trading platform, traders have the ability to develop their own trading strategies through our Expert Advisors and backtest those strategies as well.', 'Within MT4 trading platform, traders have the ability to develop their own trading strategies through our Expert Advisors and backtest those strategies as well.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 17:16:23', '2019-02-01 17:16:28'),
	(407, 'SOFTWARE_MT4_BENEFITS_ITEM2_TITLE', 'TEXT', '["6", "200", "1006", "2006", "4006", "5006", "6006", "7006", "8006", "9006"]', 'Comprehensive Charting Package', 'Paquete integral de gráficas', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 17:16:23', '2019-02-01 17:16:28'),
	(408, 'SOFTWARE_MT4_BENEFITS_ITEM2_TEXT', 'TEXT', '["6", "200", "1006", "2006", "4006", "5006", "6006", "7006", "8006", "9006"]', 'MT4 offers a comprehensive charting package allows customizing chart interface to personal requirements and provides with wide range of analytic instruments.', 'MT4 offers a comprehensive charting package allows customizing chart interface to personal requirements and provides with wide range of analytic instruments.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 17:16:23', '2019-02-01 17:16:28'),
	(409, 'SOFTWARE_MT4_BENEFITS_ITEM3_TITLE', 'TEXT', '["6", "200", "1006", "2006", "4006", "5006", "6006", "7006", "8006", "9006"]', 'Multilingual Support', 'Soporte Multilenguaje', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 17:16:23', '2019-02-01 17:16:28'),
	(410, 'SOFTWARE_MT4_BENEFITS_ITEM3_TEXT', 'TEXT', '["6", "200", "1006", "2006", "4006", "5006", "6006", "7006", "8006", "9006"]', 'MT4 supports different languages, and a MultiLanguage Pack program is included into distributive packages. It provides translation of all program interfaces into any language.', 'MetaTrader 4 es compatible con diferentes idiomas, y un módulo multilenguaje está incluido en los paquetes de distribución. Provee la traducción de todas las interfaces del programa en cualquier lenguaje.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 17:16:23', '2019-02-01 17:16:28'),
	(411, 'SOFTWARE_MT5_BENEFITS_ITEM1_TITLE', 'TEXT', '["6", "200", "1006", "2006", "4006", "5006", "6006", "7006", "8006", "9006"]', 'Built-in MetaTrader Market', 'Mercado MetaTrader incorporado', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 17:16:23', '2019-02-01 17:16:28'),
