	(506, 'ACCOUNTS_FUNDING_FUNDGBP', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', '(*It can also be funded to GBP accounts)', '(*También se puede depositar a cuentas en GBP)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:14:38', '2019-01-25 21:14:41'),
	(507, 'ACCOUNTS_FUNDING_INTROTEXT', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'You will receive an email from us that will include the following', 'Usted recibirá un correo electrónico de nosotros que incluye lo siguiente', 'ご入金に関する免責事項', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:14:44', '2019-01-31 14:30:20'),
	(508, 'ACCOUNTS_FUNDING_LISTITEM1', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'Losses can exceed initial amount invested.', 'Las pérdidas pueden exceder el monto incial invertido.', '金融商品取引は高リスクを伴う為、損失に耐えうる資金投資をして下さい', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:14:51', '2019-01-25 21:14:54'),
	(509, 'ACCOUNTS_FUNDING_LISTITEM2', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'Third party payments will <strong>NOT</strong> be accepted. All deposits <strong>MUST</strong> be from the original account owner.', 'Los depósitos de terceros <strong> NO</strong> serán aceptados. Todos los depósitos debe realizarlos el dueño de la cuenta.', 'Tradeviewは第三者からのご入金を受け付けません', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:14:58', '2019-01-25 21:15:02'),
	(510, 'ACCOUNTS_FUNDING_LISTITEM3', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'The trading platform\'s denomination is in USD.', 'La denominación de las plataformas de trading es el dólar americano.', 'カードでご入金された金額はご出金の際カードに送金されます', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:05', '2019-01-25 21:15:08'),
	(511, 'ACCOUNTS_FUNDING_LISTITEM4', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'TVF reserves the right to bookback/refund any deposits made via Credit Card in lieu of a withdrawal.', 'TVF se reserva el derecho de devolver/reembolsar depósitos realizados con tarjetas de crédito en lugar de realizar un retiro.', '場合により口座への入金反映が通常より遅れる場合がございます', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:12', '2019-01-25 21:15:15'),
	(512, 'ACCOUNTS_FUNDING_NOTICE', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', '<h3 class="display-5 text-primary">IMPORTANT NOTICE:</h3>\r\n<p class="lead"><strong>Be advised</strong>, for all credit card deposits, you are required to take a selfie picture of yourself holding your id/passport. once we have received your verification of identity form we will be able to process your transaction.</p>', '<h3 class="display-5 text-primary">AVISO IMPORTANTE:</h3>\r\n<p class="lead">Se informa que para todos los depósitos por tarjeta de crédito se requiere una foto de usted sosteniendo su identificación/pasaporte. Una vez que hayamos recibido su formato de Verificación de Identidad, podremos procesar su transacción.</p>', '<h3 class="display-5 text-primary">カード入金に関する重要事項:</h3>\r\n<p class="lead">カード入金をされる場合はお客様のカード情報のセキュリティーとアンチマネーロンダリング対策の方針に準じ、ご入金時にご本人様確認を行っております</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:18', '2019-01-25 21:15:22'),
	(513, 'ACCOUNTS_FUNDING_ALTTITLE', 'TEXT', '["0"]', 'Alternative', 'Alternativo', 'Eウォレット', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:25', '2019-01-25 21:15:28'),
	(514, 'ACCOUNTS_FUNDING_TABLETITLE', 'TEXT', '["0"]', 'Our Deposit Methods', 'Nuestros Métodos de Depósito', 'ご入金方法', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:32', '2019-01-25 21:15:35'),
	(515, 'ACCOUNTS_FUND_GCEN_INTROTEXT', 'TEXT', '["0"]', 'Tradeview accepts deposits by debit card and bank wire. Funds deposited by debit card become available the soonest—sometimes, instantaneously. Mainstream Fund Services, Inc. and Tradeview Ltd. have entered in a relationship where Mainstream provides custodial and cash management services for Tradeview Ltd. Mainstream Fund Services, Inc. has additionally established a relationship with Global Custodial Services, Inc. to open and operate accounts held with Santander.', 'Tradeview acepta depósitos por medio de tarjeta débito y transferencia bancaria. Los fondos depositados por tarjeta débito están disponibles lo más pronto posible y algunas veces, instantáneamente. Mainstream Fund Services, Inc. y Tradeview Ltd. sostienen una relación en la que Mainstream brinda servicios de custodia y administración de efectivo para Tradeview Ltd. Mainstream Fund Services, Inc. también ha establecido una relación con Global Custodial Services, Inc. para abrir y operar cuentas celebrado con Santander.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:39', '2019-01-25 21:15:42'),
