	(1124, 'FORM_DECLARATION_C', 'TEXT', '["0"]', '(c) I confirm that I am not a U.S. citizen or resident in the U.S. for tax purposes.', '(c) Confirmo que no soy ciudadano o residente estadounidense para propósitos de impuestos.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-24 17:00:26', '2019-01-24 17:00:33'),
