	(1150, 'FORM_SOURCE_FUNDS_TEXT', 'TEXT', '["0"]', '(Please give full particulars including country of origin. Phrases such as \'transferred from another company\' or \'investments\' are not sufficient. If the wealth is derived from the sale of a business, the description should indicate the name of the business & activities of the company. If the funds were generated through accumulated earnings, the affidavit should include information as to your employer, your position, & number of years employed. Specific details of the source of funds introduced are essential to enable us to confirm the funds are legal in origin. We reserve the right to request further documentation to support this declaration.)', '(Por favor, suministre la información detallada incluyendo el país de origen. Frases como "transferido desde otra compañía" o "inversiones" no son suficientes. Si los recursos son derivados de la venta de un negocio, la descripción debería indicar el nombre del negocio y las actividades de la compañía. Si los recursos fueron generados a través de ganancias acumuladas, la declaración jurada debería incluir información como su empleador, su posición y el número de años trabajando. Los detalles específicos de la fuente de recursos introducidos son eseciales para que podamos confirmar que los fondos son legales desde el origen. Nos reservamos el derecho de solicitar documentación adicional para dar soporte a esta declaración.)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-24 17:00:26', '2019-01-24 17:00:33'),
