	(4024, 'FXRESOURCES_CFD_ETFEXAMPLES_PARAGRAPH01', 'TEXT', '["0"]', '<ul class="list-dot font-weight-light">\r\n				        <li>With CFD trading you buy a CFD based on a certain amount of the underlying asset. In this case, we will examine how to trade ETF.</li>\r\n				        <li>The following worked examples show how you can use CFDs to trade a number of different markets.</li>\r\n				        <li>These examples show trades that result in both profits and losses.</li>\r\n				        <li>CFD trading example (ETF) - Buying SPDR (SPY).</li>\r\n				        <li>You believe that the shares of SPY will rise, so you decide to buy a CFD based on 2000 shares.</li>\r\n				        <li>Tradeview Forex quotes you a spread of $84.68/$84.70 for SPDR (SPY).</li>\r\n				    </ul>', '<ul class="list-dot font-weight-light">\r\n				        <li>Con CFD trading usted podrá comprar CFD basado en cierto monto del asentamiento subyacente. En este caso podemos ver como transar ETF.</li>\r\n				        <li>Los siguientes ejemplos realizados demuestran cómo usar CFD´s para transar un numero de diferentes mercados.</li>\r\n				        <li>Estos ejemplos muestran como realizar operaciones Trading que resulten tanto en las ganancias como en las pérdidas.</li>\r\n				        <li>Ejemplos de operaciones Trading CFD (ETF) en BMF pro-compras SPDR (SPY).</li>\r\n				        <li>Si usted cree que las acciones SPY ascenderán, puede decidir comprar basado en 2000 acciones.</li>\r\n				        <li>Tradeview Forex cree que usted puede alcanzar spreads de $84.68/$84.70 por SPRD (SPY).</li>\r\n				    </ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 20:56:36', '2019-02-07 20:56:39'),
