	(4039, 'FXRESOURCES_CFD_ETFFACTS_OFFER', 'TEXT', '["0"]', 'Exchange traded funds offer individual investors:', 'Intercambio de fondos negociados que se ofrecen a los inversores individuales:', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 21:51:10', '2019-02-07 21:51:14'),
	(4040, 'FXRESOURCES_CFD_ETFFACTS_PARAGRAPH01', 'TEXT', '["0"]', '<ul class="list-dot font-weight-light">\r\n			        <li>Advantages of stocks and mutual funds combined</li>\r\n			        <li>Lower fees** (ordinary brokerage commissions apply)</li>\r\n			        <li>Lower capital gains taxes**</li>\r\n			    </ul>\r\n\r\n			    <p>\r\n			        Recently, these exceptional features and benefits have helped exchange traded funds explode in popularity and emerge as one \r\n			        of the most flexible, multi-purpose investment vehicles available.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Ever since the American Stock Exchange championed and pioneered the concept of a tradable basket of stocks with the creation \r\n			        of the Standard & Poor\'s Depositary Receipt (SPDR) in 1993, exchange traded funds have evolved into a completely new \r\n			        investment category. \r\n			    </p>\r\n\r\n			    <p>\r\n			        Today, the number of ETFs listed and traded at the Amex has grown to more than 180 and continues to grow—not only in \r\n			        the number of products and their variety—but also in terms of assets and market value.\r\n			    </p>', '<ul class="list-dot font-weight-light">\r\n			        <li>Advantages of stocks and mutual funds combined</li>\r\n			        <li>Tarifas más bajas (se aplican comisiones de corretaje ordinarias)</li>\r\n			        <li>Menores impuestos sobre ganancias de capital**</li>\r\n			    </ul>\r\n\r\n			    <p>\r\n			       Recientemente estas excepcionales características y beneficios han ayudado al intercambio de fondos cotizados y ascienden con popularidad como unos de los instrumentos de intercambios más flexibles y disponibles.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Desde la Bolsa de Valores de Estados Unidos se defendió y fue pionera en el concepto de tener un grupo de acciones negociables con la creación del Certificado de Depósito del Standard & Poors (SPDR) en 1993, estos fondos cotizados se han convertido en una nueva categoría de inversión. \r\n			    </p>\r\n\r\n			    <p>\r\n			        Hoy, el número de ETF´s listados y transados en el Amex ha incrementado a más de 180 y continúan creciendo no solo en la variedad de productos, también en términos de activos y valores del mercado.\r\n			    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 22:00:22', '2019-02-07 22:00:26'),
	(4041, 'FXRESOURCES_CFD_ETFFACTS_WHATEXCHANGE', 'TEXT', '["0"]', 'What are exchange traded funds?', '¿Qué son fondos de intercambio transados?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 22:02:31', '2019-02-07 22:02:41'),
	(4042, 'FXRESOURCES_CFD_ETFFACTS_PARAGRAPH02', 'TEXT', '["0"]', '<p>\r\n			        Exchange traded funds (ETFs) are index funds or trusts* that are listed on an exchange and can be traded intraday. \r\n			        Investors can buy or sell shares in the collective performance of an entire portfolio as a single security. Exchange traded \r\n			        funds add the flexibility, ease, and liquidity of stock trading to the benefits of traditional index fund investing.\r\n			    </p>\r\n\r\n			    <p>\r\n			        The American Stock Exchange lists ETFs on more than 180 broad stock market, stock industry sector, international stock, \r\n			        U.S. Treasury, and corporate bond indexes and commodities, providing a vast selection of investment opportunities. ETFs \r\n			        provide a simple and effective way to invest in markets all over the world. Investors can set long-term investments in \r\n			        the market performance of the top companies in the top industries within the United States or abroad, or customize asset \r\n			        allocations using diversified investments in stocks in particular industries or countries or in U.S. bonds or commodities.\r\n			    </p>', '<p> Los fondos de intercambio transados (ETF´s) son fondos de índice o fideicomisos listados en el intercambio y pueden ser transados intradía. Los inversores pueden comprar o vender acciones en el desempeño colectivo de un portafolio completo como un solo valor. El intercambio de fondos transados agrega la flexibilidad, facilidad y liquidez de operaciones Trading de acciones para los beneficios del fondo de inversiones tradicional listado. </p>\r\n<p> La bolsa de valores de los Estados Unidos de América enumera los ETF´s en más de 180 con una gran amplitud en el mercado de valores, en el sector industrial de acciones, valores internacionales, tesorería e índices de bonos corporativos y commodities, de esta manera proporciona una amplia selección de oportunidades de inversión. ETF´s provee una forma simple y efectiva de inversión en los mercados del mundo. Los inversores pueden establecer inversiones en el mercado de las empresas a largo plazo, en las principales industrias de los Estados Unidos o del extranjero o personalizar las asignaciones de activos con inversiones diversificadas en acciones, sectores o países en particular, en bonos o commodities de los Estados Unidos.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 22:05:25', '2019-02-07 22:05:28'),
	(4043, 'FXRESOURCES_CFD_ETFFACTS_ADVANTAGE', 'TEXT', '["0"]', 'The advantages of ETFs:', 'Ventajas de EFT´s:', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 22:08:50', '2019-02-07 22:08:53'),
	(4044, 'FXRESOURCES_CFD_ETFFACTS_PARAGRAPH03', 'TEXT', '["0"]', '<p>\r\n			        <strong>Tax efficiency**</strong><br />\r\n			        ETFs, like index funds, offer greater tax benefits because they create fewer capital gains due to low turnover of the \r\n			        securities that comprise the portfolio. Generally, an ETF only sells securities to reflect changes in its underlying index. \r\n			        Exchange trading of ETFs further enhances their tax efficiency. Investors who want to liquidate shares in an ETF simply sell \r\n			        them to other investors through exchange trading.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Because of this particular structure, ETFs are not required to sell securities to meet investor cash redemptions, potentially \r\n			        generating capital gains tax liability for remaining investors. Keep in mind that the sale of an ETF will generate capital \r\n			        gains/losses for the investor liquidating shares.\r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Lower costs**</strong><br />\r\n			        Expenses can have a masive impact on returns for investors. ETFs usually have a notoriously lower annual expense ratio \r\n			        than other investment products. ETFs are less likely to experience high management fees because they are index-based, \r\n			        not &quot;actively&quot; managed.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Since they trade on an exchange, ETFs are insulated from the costs of having to buy and sell securities to accommodate \r\n			        shareholder purchases and redemptions. An investor selling ETF shares may realize capital gains or losses, as with common \r\n			        stocks. Purchases or sales of exchange traded funds are subject to brokerage commissions.\r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Transparency</strong><br />\r\n			        ETFs are usually designed to match the performance of their underlying index or commodity.\r\n			    </p>\r\n\r\n			    <p><strong>Buying and selling flexibility</strong><br />\r\n			    Because they are exchange traded, ETFs can be:</p>\r\n			    <ul class="list-dot font-weight-light">\r\n			        <li>Bought and sold at intraday market prices</li>\r\n			        <li>Purchased on margin</li>\r\n			        <li>Sold short</li>\r\n			        <li>Traded using stop orders and limit orders, which help investors to specify the price points at which they are \r\n			            willing to trade</li>\r\n			    </ul>    \r\n\r\n			    <p>\r\n			        <strong>All day tracking and trading</strong><br />\r\n			        ETFs are priced and traded throughout the day, and are not restricted to once-a-day trading at the end of the day.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Due to the pricing of ETFs is continuous during trading hours, investors will always be able to obtain updated share \r\n			        prices from their broker or financial adviser.\r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Diversification*</strong><br />\r\n			        Since each ETF is comprised of a basket of securities, it inherently provides diversification across an entire index. \r\n			        Also, the expanding possibilities of ETFs available at the American Stock Exchange offer exposure to a diverse variety \r\n			        of markets, including:\r\n			    </p>\r\n\r\n			    <ul class="list-dot font-weight-light">\r\n			        <li>Broad-based equity indexes (i.e.: as total market, large-cap growth, and small-cap value)</li>\r\n			        <li>Broad-based international and country-specific equity indexes (i.e.: Europe, EAFE, and Japan)</li>\r\n			        <li>Industry sector-specific equity indexes (i.e.: healthcare, energy, and real estate) </li>\r\n			        <li>U.S. bond indexes (i.e.: long-term Treasury bonds and corporate bonds) </li>\r\n			        <li>Commodities (i.e.: gold, silver, and oil)</li>\r\n			    </ul>\r\n\r\n			    <p>\r\n			        <strong>Dividend opportunities</strong><br />\r\n			        Dividends paid by companies and interest paid on bonds held in an ETF are distributed to ETF holders, less expenses, \r\n			        on a pro rata basis.\r\n			    </p>\r\n\r\n			    <p>\r\n			        However, not all companies will pay dividends. Based on past performance, few distributions can be expected from \r\n			        certain ETFs. There may also be opportunities for reinvestment of distributions. \r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Wide array of investment strategies</strong><br />\r\n			        Investors can benefit from the convenience and flexibility of ETFs to pursue a vast array of investment strategies.\r\n			    </p>\r\n			    \r\n			    <ul class="list-group pb-4 px-4">\r\n			        <li class="list-group-item"><h5 class="text-muted">Core investment</h5>\r\n						Investors can use ETFs as a core investment for their portfolio. The purchase of shares in a single            \r\n						ETF can provide broad market exposure for long-term holding that is simple to establish, easy to track, inexpensive, \r\n			            and tax efficient.road-based equity indexes (i.e.: as total market, large-cap growth, and small-cap value)</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Portfolio diversification</h5>\r\n						ETFs cover virtually every segment of the equity market and several segments of the \r\n			            U.S. bond market and commodities, providing an easy and convenient way to adjust the investment mix of a core portfolio.</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Hedging</h5>\r\n						Exchange traded funds can be purchased on margin and sold short, which has opened up risk management \r\n			            strategies for individual investors that were available just for large institutions. For example, ETFs can be sold short \r\n			            to hedge a core stock portfolio or interest rate fluctuations. This allows investors to keep their portfolio intact \r\n			            while protecting them from market losses.<br>\r\n			            <br>\r\n			            In a declining stock market or rising interest rate environment, profits from a short position can offset some of the losses in a portfolio. (Investors are required to make arrangements to borrow securities before selling short.) Listed options, available on some ETFs, also offer chances for additional hedging or to increase income. Investors should contact their broker regarding initial and maintenance margin requirements.</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Cash management</h5>\r\n						ETFs have often been used to &quot;equitize&quot; cash, providing a way for investors to \r\n			            put cash to work in the market or maintain allocation targets while determining where to invest for the longer term.</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Rebalancing</h5>\r\n						Investors can adjust ETF positions whenever they need to throughout the trading day, without \r\n			            redemption fees or short-term restrictions. Usual brokerage commissions will apply.</li>\r\n					<li class="list-group-item"><h5 class="text-muted">Tax loss strategy</h5>\r\n						An investor can sell a security that is underperforming and claim a tax loss but retain \r\n			            exposure to its sector by investing in an ETF. It is recommended to consult a tax advisor about a tax loss strategy.</li>\r\n			    </ul>', '<p>\r\n			        <strong>Eficiencia Tributaria**</strong><br>\r\n			       ETFs al igual que los fondos de índice ofrecen mayores beneficios tributarios ya que crean menores ganancias de capital debido a la baja rotación de los valores que contienen el portafolio. Generalmente un ETF solo vende valores para reflejar los cambios en el índice subyacente. El intercambio Trading de ETF´s mejora cada vez más su eficiencia fiscal. Los inversores que quieren liquidar acciones en ETF´s pueden fácilmente venderlas a otros inversores por medio del intercambio Trading.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Por causa de esta particular estructura, los ETF´s no requieren vender valores para cumplir con los reembolsos de los inversores, potencialmente generando ganancias de capital como responsabilidad fiscal para los inversores restantes. Es necesario tener en cuenta que la venta de un ETF generará pérdidas o ganancias de capital para la liquidación de acciones del inversor.\r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Costos más bajos**</strong><br />\r\n			       Los gastos pueden tener un enorme impacto en el rendimiento de los inversores. Los ETF´s usualmente tienen un radio más notorio de gastos anuales que otros productos de inversión. Los ETF´s son menos propensos a experimentar altas tasas de gestión puesto que están basados en índices y no “activamente” administrados.\r\n			    </p>\r\n\r\n			    <p>\r\n			       Debido a las operaciones Trading en los intercambios, los ETF´s son aislados de los costos de tener que comprar y vender valores para acomodar las compras accionistas y los reembolsos. Un inversor vende una acción ETF y esto puede generar ganancias o pérdidas, como sucede con las acciones ordinarias. La compra o venta de fondos intercambiados y transados está sujeta a las comisiones de la intermediación.\r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Transparencia</strong><br />\r\n			       Los ETFs son usualmente diseñados para coincidir con el rendimiento de sus índices subyacentes o commodities.\r\n			    </p>\r\n\r\n			    <p><strong>Flexibilidad de compra y venta</strong><br />\r\n			    Puesto que son intercambios Trading, Los ETF´s pueden ser:</p>\r\n			    <ul class="list-dot font-weight-light">\r\n			        <li>Comprados y vendidos intradía y a precios de mercado</li>\r\n			        <li>Comprados al margen</li>\r\n			        <li>Ventas cortas</li>\r\n			        <li>Transados usando ordenes y ordenes de limite, esto ayuda a los inversores a especificar los puntos de precio en los que están dispuestos a transar (negociar)</li>\r\n			    </ul>    \r\n\r\n			    <p>\r\n			        <strong>Trading y seguimiento todo el día</strong><br />\r\n			       Los ETFs tienen un precio y se negocian durante todo el día y no están restringidos a una sola vez en el día, están disponibles hasta el final de este.\r\n			    </p>\r\n\r\n			    <p>\r\n			       Debido a que los precios de los ETF´s son continuos durante las horas Trading los inversores podrán obtener siempre precios de acciones de sus Brokers o asesores financieros.\r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Diversificación*</strong><br />\r\n			        Dado que cada ETF se compone de una cesta de valores, inherentemente proporciona una diversificación a través de un índice completo. Además las posibilidades de expansión de ETF´s disponibles en las acciones Americanas ofrecen una amplia variedad de mercados incluyendo:\r\n			    </p>\r\n\r\n			    <ul class="list-dot font-weight-light">\r\n			        <li>Indices de renta variable y base amplia (como el mercado total, el crecimiento de la capitalización grande y pequeña y el valor de capitalización.</li>\r\n			        <li>Amplia base internacional y de países específicos de índices de renta variable (Europa, EAFE y Japón)</li>\r\n			        <li>Indices de renta variable específicos del sector industrial (salud, energía y bienes raíces). </li>\r\n			        <li>Indices de bonos de Estados Unidos (Bonos corporativos y a largo plazo)</li>\r\n			        <li>Commodities (Oro, plata y aceite)</li>\r\n			    </ul>\r\n\r\n			    <p>\r\n			        <strong>Oportunidades de Dividendos</strong><br />\r\n			       Los dividendos pagados por las compañías al igual que el interés pagado en bonos en un EFT son distribuidos a los titulares ETF´s, menos gastos sobre una base prorrata.\r\n			    </p>\r\n\r\n			    <p>\r\n			       Sin embargo no todas las compañías pagarán dividendos. Basados en los resultados anteriores, se pueden esperar pocas distribuciones de algunos ETF´s, También puede haber oportunidades por reinversión de las distribuciones.\r\n			    </p>\r\n\r\n			    <p>\r\n			        <strong>Amplia Gama de Estrategias de Inversión</strong><br />\r\n			       Los inversores pueden beneficiarse de la conveniencia y flexibilidad de los ETF´s para llevar a cabo una amplia gama de estrategias de inversión.\r\n			    </p>\r\n			    \r\n			    <ul class="list-group pb-4 px-4">\r\n			        <li class="list-group-item"><h5 class="text-muted">Inversión de Cartera Básica</h5>\r\n						Los inversores pueden usar los ETF´s como inversiones de cartera básica para su portafolio. La compra o adquisición de acciones en un solo ETF puede proporcionar una amplia exposición al mercado a largo plazo que es fácil de establecer, fácil de seguir, económica y basada en índices de acciones.</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Diversificación de portafolio</h5>\r\n						Los ETFs cubren virtualmente cada segmento del mercado de renta variable de los bonos y commodities de los Estados Unidos proporcionando así una forma fácil y conveniente para ajustar la combinación de inversiones de una cartera básica.</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Cobertura</h5>\r\n						El intercambio de fondos transados puede ser adquirido y vendido en corto plazo, esto ha ampliado las estrategias de gestión de riesgos para los inversores individuales dicho beneficio solo estaba disponible para grandes instituciones. Por ejemplo, los ETF’s pueden ser vendidos en cortos plazos para cubrir los portafolios de carteras básicas o las fluctuaciones de las tasas de interés. Esto permite a los inversores mantener un portafolio intacto mientras se protegen de las pérdidas del mercado.<br>\r\n			            <br>\r\n			            En un mercado de valores en declive o aumento de las tasas de interés, una posición corta puede ser beneficiosa y compensar parte de las pérdidas en una cartera. (Se requiere que los inversores hagan los arreglos necesarios para el préstamo de valores antes de la venta corta. Las opciones cotizadas están disponibles en algunos ETF´s, también ofrecen posibilidades de cobertura adicional o para aumentar los ingresos. Los inversores deben contactar a su Broker para estar al tanto de los requisitos iniciales y del mantenimiento de margen.</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Gestión de Tesorería</h5>\r\n						Los ETF´s son a menudo usados para hacer equitativas las gestiones de tesorería, éstos proporcionan una manera a los inversores para poner a funcionar su dinero en el mercado o mantener sus objetivos de asignación al determinar dónde invertir a largo plazo.</li>\r\n			        <li class="list-group-item"><h5 class="text-muted">Reestabilización</h5>\r\n						Los inversores pueden ajustar sus posiciones ETF en el momento en que así lo deseen durante todo el día Trading, sin comisión de reembolso ni restricciones a corto plazo. Se aplicarán condiciones habituales de corretaje.</li>\r\n					<li class="list-group-item"><h5 class="text-muted">Estrategia de pérdida de impuestos</h5>\r\n						Un inversor puede vender un valor de bajo rendimiento y reclamar una pérdida fiscal pero mantener la exposición a su sector por inversión en un ETF. Se recomienda consultar con un asesor fiscal a cerca de la estrategia de pérdida de impuestos.</li>\r\n			    </ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 13:54:02', '2019-02-08 13:54:06'),
	(4045, 'FXRESOURCES_CFD_ETFFACTS_RISKCONSIDERATION', 'TEXT', '["0"]', 'Risks and other considerations', 'Riesgos y Otras Consideraciones', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 13:56:55', '2019-02-08 13:56:59'),
	(4046, 'FXRESOURCES_CFD_ETFFACTS_PARAGRAPH04', 'TEXT', '["0"]', '<p>\r\n			        ETF shareholders are subject to risks similar to those of holders of other diversified portfolios. A basic consideration \r\n			        is that the general level of securities or commodities may decline, affecting the value of an exchange traded fund because \r\n			        ETFs represent interest in securities or commodities.\r\n			    </p>\r\n\r\n			    <p>\r\n			        When interest rates rise, bond prices will probably decline, affecting adversely the value of fixed income ETFs. Moreover, \r\n			        the overall depth and liquidity of the secondary market may also fluctuate.\r\n			    </p>\r\n\r\n			    <p>\r\n			        An exchange traded sector fund may also be adversely affected by the performance of that specific sector or group of \r\n			        industries on which it is based. \r\n			    </p>\r\n\r\n			    <p>\r\n			        International investments may involve risk of capital loss from unfavorable fluctuations in currency values, differences in \r\n			        generally accepted accounting principles, or economic, political instability in other nations.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Although exchange traded funds are designed to provide investment results that generally correspond to the price and yield \r\n			        performance of their respective underlying indexes or commodities, the trusts may not be able to exactly replicate that performance \r\n			        because of trust expenses and other factors.\r\n			    </p>\r\n\r\n			    <p class="text-muted">\r\n			        <strong>*</strong> iShares COMEX Gold Trust, iShares Silver Trust, and United States Oil Fund are not index funds or diversified \r\n			        baskets of securities. ProShares seek performance that corresponds to a multiple, inverse, or inverse multiple of an index.\r\n			    </p>\r\n\r\n			    <p class="text-muted">\r\n			        <strong>**</strong> ProShares Trust portfolios will experience high levels of portfolio turnover, which will increase transaction \r\n			        expenses and may be more likely to generate taxable short-term capital gains than other ETFs.\r\n			    </p>', '<p>\r\n			       Los accionistas ETF están sujetos a riesgos similares a los de otros titulares de carteras diversificadas. Una consideración básica es que el nivel general de valores o commodities puede declinar afectando el valor del fondo de un intercambio transado por que los ETF´s representan interés en valores o commodities.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Cuando las tasas de interés suben, los precios de los bonos probablemente declinarán afectando negativamente el valor de los ETF´s de renta fija. Por otra parte la profundidad y liquidez general del mercado secundario pueden también decaer.\r\n			    </p>\r\n\r\n			    <p>\r\n			       Un fondo sectorial transado de intercambio puede también verse afectado por el rendimiento de dicho sector o conjunto de sectores en los que se basa.\r\n			    </p>\r\n\r\n			    <p>\r\n			       Las inversiones internacionales pueden envolver riesgos de capital debido a fluctuaciones desfavorables en los valores de las monedas, diferencias en los principios contables generalmente aceptados, o por la inestabilidad económica o política en otras naciones.\r\n			    </p>\r\n\r\n			    <p>\r\n			        Aunque el intercambio de fondos transados está diseñado para proporcionar resultados que generalmente correspondan al precio y el rendimiento de sus respectivos índices o commodities subyacentes, los fideicomisos pueden no ser capaces de reproducir con exactitud el rendimiento debido a los gastos del mismo y otros factores.\r\n			    </p>\r\n\r\n			    <p class="text-muted">\r\n			        <strong>*</strong>Los iShares COMEX Gold Trust, iShares Silver Trust, y United States Oil Funds, no son índices de fondos o canastas diversificadas de valores. Los Proshares buscan un rendimiento que corresponda a una múltiple inversa de índices\r\n			    </p>\r\n\r\n			    <p class="text-muted">\r\n			        <strong>**</strong> Los portafolios de fideicomisos Proshares experimentarán altos niveles de rotación, por lo cual incrementarán los costos en las transacciones y puede ser más probable que genere ganancias de capital a corto plazo, más ganancias que con otros ETF´s.\r\n			    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 14:05:55', '2019-02-08 14:06:03'),
	(4047, 'FXRESOURCES_CFD_EQUITIES_PARAGRAPH01', 'TEXT', '["0"]', '<ul class="list-dot font-weight-light">\r\n			        <li>As with traditional share dealing, CFD prices are quoted as a Bid (the price you can sell at) and an Offer (the price you \r\n			        can buy at). With CFD trading you buy a CFD based on a certain amount of the underlying asset.</li>\r\n			        <li>The following worked examples show how you can use CFDs to trade a number of different markets.</li>\r\n			        <li>These examples show trades that result in both profits and losses.</li>\r\n			        <li>CFD trading example (Equities) - Buying Yahoo (YHOO)</li>\r\n			        <li>You believe that the shares of Yahoo will rise, so you decide to buy a CFD based on 3000 shares.</li>\r\n			        <li>Tradeview Forex quotes you a spread of $13.47/$13.49 for Yahoo (YHOO).</li>\r\n			    </ul>', '<ul class="list-dot font-weight-light">\r\n			        <li>Como los negocios sobre acciones tradicionales, los precios CFD son citados como una invitación (el precio al que se pueden vender) y una oferta (el precio al que se pueden comprar). Con CFD usted puede comprar un CFD basado en cierto monto del activo subyacente.</li>\r\n			        <li>Los siguientes son ejemplos son trabajados para mostrar cómo se pueden usar los CFD´s para transar diferentes mercados.</li>\r\n			        <li>Estos ejemplos le mostrarán cómo una operación Trading puede resultar en beneficios o pérdidas.</li>\r\n			        <li>Ejemplo de CFD Trading, (acciones) en BMF Pro- compra Yahoo (YAHOO).</li>\r\n			        <li>Si usted cree que las acciones de Yahoo ascenderán, puede decidir comprar un CFD basado en 3000 acciones.</li>\r\n			        <li>Tradeview Forex le cotiza un spread de $13.47/$13.49 para Yahoo (YAHOO).</li>\r\n			    </ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 14:26:08', '2019-02-08 14:26:11'),
	(4048, 'FXRESOURCES_CFD_EQUITIES_YHOO', 'TEXT', '["0"]', 'Price of YHOO', 'Precio de YAHOO', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 14:43:31', '2019-02-08 14:43:35'),
	(4050, 'FXRESOURCES_CFD_EQUITIES_TRANSFEE', 'TEXT', '["0"]', 'Transaction Fee @ $.10 per share', 'Tarifa Transacción @ $.10 por acción', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 15:25:35', '2019-02-08 15:25:39'),
	(4052, 'FXRESOURCES_CFD_FUTURES_PARAGRAPH01', 'TEXT', '["0"]', '<ul class="list-dot font-weight-light">\r\n			        <li>With CFD trading you buy a CFD based on a certain amount of the underlying asset. In this case, we will examine how to trade futures.</li>\r\n			        <li>The following worked examples show how you can use CFDs to trade a number of different markets.</li>\r\n			        <li>These examples show trades that result in both profits and losses.</li>\r\n			        <li>CFD trading example (Index) - Selling the US TECH 100</li>\r\n			        <li>You believe that the US TECH 100 will fall so you decide to sell a CFD based on 100 underlying futures contracts for that market.</li>\r\n			        <li>Tradeview Forex quotes you a spread of $13.47/$13.49 for Yahoo (YHOO).</li>\r\n			    </ul>', '<ul class="list-dot font-weight-light">\r\n			        <li>Con CFD Trading comrpas CFD With CFD basado en una cierta cantidad de activos subyacentes. En este caso, examinaremos como tranzar los futuros.</li>\r\n			        <li>Los siguientes ejemplos trabajados mostrarán como usar CFDs para tranzar un número differente de mercados.</li>\r\n			        <li>Estos ejemplos muestran intercambios que resultan en las dos cosas, ganancias y perdidas.</li>\r\n			        <li>Ejemplo de CFD Trading, (Indice) - Vendiendo US TECH 100</li>\r\n			        <li>Si usted cree queUS TECH 100 caerán, puede decidir vender un CFD basado en 100 contratos futuros subyacentes para el mercado.</li>\r\n			        <li>Tradeview Forex le cotiza un spread de $13.47/$13.49 para Yahoo (YAHOO).</li>\r\n			    </ul>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 16:29:59', '2019-02-08 16:30:02'),
	(4054, 'FXRESOURCES_CFD_FUTURES_USTECH', 'TEXT', '["0"]', 'Price of US TECH 100', 'Precio de US TECH 100', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 17:03:59', '2019-02-08 17:04:03'),
	(4055, 'FXRESOURCES_CFD_FUTURES_TRANSFEE', 'TEXT', '["0"]', 'Transaction Fee $.75 per contract', 'Tarifa de transacción @ $.75 per contrato', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 21:57:33', '2019-02-08 21:57:36'),
	(4056, 'FORM_DEPOSIT_TEMPORARILYDISABLED', 'TEXT', '["0"]', 'You are in test environment, deposits generated on this page will have no effect.', 'Este es un entorno de pruebas, cualquier depósito realizado en esta página, no tendrá efecto.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-29 19:17:04', '2019-01-29 19:17:07'),
	(4057, 'FXRESOURCES_CFD_FUTURES_MARGIN', 'TEXT', '["0"]', 'Margin requirement @ 5% ($)', 'Requerimiento de margen @ 5% ($)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-08 22:02:06', '2019-02-08 22:02:09'),
	(4059, 'FXRESOURCES_CFD_FUTURES_TECH100', 'TEXT', '["0"]', 'Price of US TECH 100', 'Precio de US TECH 100', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 13:25:34', '2019-02-11 13:25:37'),
	(4060, 'FXRESOURCES_CFD_FUTURES_UNDERCONTRACT', 'TEXT', '["0"]', 'Number of underlying contracts', 'Numero de acciones subyacentes', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 13:58:25', '2019-02-11 13:58:29'),
	(4061, 'FXRESOURCES_CFD_TYPES_PARAGRAPH01', 'TEXT', '["0"]', '<p>\r\n		        Orders are trading tools that help the trader to fully or partially open, close, or amend positions.\r\n		        They are useful for managing risk.\r\n		    </p>\r\n\r\n		    <p>\r\n		        At Tradeview Forex, we have a range of orders to help you get into, and out of, positions at the price\r\n		        you want to.\r\n		    </p>', '<p>\r\n		        Las órdenes son herramientas Trading que le ayudarán en sus operaciones Trade de aperturas completas o parciales, cierres o rectificaciones de posición, son útiles para el manejo de riesgos.\r\n		    </p>\r\n\r\n		    <p>\r\n		        En Tradeview Forex, tenemos un rango de órdenes que le permitirán ingresar o salir, las posiciones están disponibles al precio que usted desee.\r\n		    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 14:16:39', '2019-02-11 14:16:43'),
	(4062, 'FXRESOURCES_CFD_TYPES_LIMITS', 'TEXT', '["0"]', 'Limit Orders', 'Ordenes de límite', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 14:19:50', '2019-02-11 14:19:54'),
	(4063, 'FXRESOURCES_CFD_TYPES_PARAGRAPH02', 'TEXT', '["0"]', '<p>\r\n		        A Limit Order is an instruction to buy or sell a market when it reaches a price that surpasses the prevailing, at the time\r\n		        of placing the Order. It can be used to open a new position, where you anticipate a more favorable market price (either\r\n		        buy or sell). It can also be used to close an existing Open Position, when a market reaches a certain level.\r\n		    </p>\r\n\r\n		    <p>\r\n		        For instance, if our quote for UK 100 Rolling Spread is 5873.8 / 5875.8\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>To open a new position:</strong><br />\r\n		        If you thought the market was going to reach 5700.5 and then reverse and go higher, and you had no Open\r\n		        Position in the market, you would leave a new Limit Buy Order at 5700.5. If the price reaches 5700.5 or lower,\r\n		        then the Order is activated and you would have a new long (buy) position in the market.\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>To close a position:</strong><br />\r\n		        If you were long (had a buy position) in the market and wished to take your profit when the market reached\r\n		        5950.8, you would leave a Limit Sell Order at 5950.8, which would activate when the Sell price hit 5950.8 or\r\n		        higher. If activated, this Order would close your position and realize any profit (or loss if you opened your\r\n		        position above 5950.8.).\r\n		    </p>', '<p>\r\n		       Una orden de límite es una instrucción para comprar o vender un mercado cuando este alcanza un precio que sobrepasa el que prevalece en el momento de establecer la orden. Puede ser usada para abrir nuevas posiciones, donde usted se anticipa a los precios más favorables del mercado (También puede comprar o vender). Además puede ser usada para cerrar posiciones abiertas existentes cuando un mercado alcanza ciertos niveles.\r\n		    </p>\r\n\r\n		    <p>\r\n		        Por Ejemplo, si el margen del spread de su cotización para UK100 es 5873.8/5875.8\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>Para abrir una nueva posición: </strong><br />\r\n		        Si usted pensó que el mercado iba a alcanzar 5700.5 y luego da reversa y va más alto, y no tenía su posición abierta en el mercado, usted puede dejar un nuevo límite de orden de compra a 5700.5. Si el precio alcanza los 5700.5 o es más bajo, entonces la orden es activada y usted tendría una nueva y extensa posición en el mercado (compra)\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>Para Cerrar una Posición:</strong><br />\r\n		        Si usted tenía una posición (compra) extensa en el mercado y deseaba tomar su beneficio cuando el mercado alcanzara los 5950.8, debe dejar un límite de orden de venta de 5950.8 que se activará cuando el precio de la venta llegue a 5950.8 o más alto. Si se activa, ésta orden cerrará su posición y realizará el beneficio (o la pérdida si usted abrió su posición sobre 5950.8).\r\n		    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 14:28:08', '2019-02-11 14:28:13'),
	(4064, 'FXRESOURCES_CFD_TYPES_STOP', 'TEXT', '["0"]', 'Stop Orders', 'Ordenes de detención', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 14:30:50', '2019-02-11 14:30:54'),
	(4065, 'FXRESOURCES_CFD_TYPES_PARAGRAPH03', 'TEXT', '["0"]', '<p>\r\n		        A Stop Order is an instruction to buy or sell a market at a price which is worse than that prevailing, at the time\r\n		        of placing the Order. It can be used to open a position if there is a chance that a market could move even higher once\r\n		        it moves above a particular level (when buying), or even lower if it moves lower than a particular level (when selling).\r\n		        Stop orders can also be used to close a position (a tool for managing risk).\r\n		    </p>\r\n\r\n		    <p>\r\n		        E.g. If our quote for Australian 200 CFD is 5100 / 5106\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>To open a new position:</strong><br />\r\n		        If you felt that the market traded up to 5150 and it would continue even higher, then you would leave a new Stop\r\n		        Order to Buy at 5150. If the Buy price hit 5150 or higher, the Order would execute and open a long position.\r\n		    </p>', '<p>\r\n		        Una orden de detención es una instrucción para comprar o vender un mercado al precio inferior que el que prevalece en el momento de establecer la orden. Puede ser usada para abrir una posición si hay oportunidad de que un mercado se mueva más alto y una vez que lo haga a un nivel particular (al comprar) o incluso un nivel particularmente bajo (al vender). Las órdenes de detención pueden usarse también para cerrar una posición (herramienta de manejo de riesgos)\r\n		    </p>\r\n\r\n		    <p>\r\n		       E.G. Si nuestra cotización para Australia 200 es 5100 / 5106\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>Para abrir una Nueva Posición:</strong><br />\r\n		       Si usted cree que el mercado transado supera los 5150 y continuará subiendo puede dejar una nueva orden de detención para comprar a 5150. Si el precio de compra llega a los 5150 o más alto aun, la orden se ejecutará y se abrirá una posición extensa.\r\n		    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 14:36:47', '2019-02-11 14:36:50'),
	(4066, 'FXRESOURCES_CFD_TYPES_LOSSORDER', 'TEXT', '["0"]', 'Stop Loss Orders', 'Ordenes de detención de pérdidas', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 14:41:09', '2019-02-11 14:41:21'),
	(4067, 'FXRESOURCES_CFD_TYPES_PARAGRAPH04', 'TEXT', '["0"]', '<p>\r\n		        A Stop loss order is an instruction to buy or sell a market at a price which is lower than the opening price of an\r\n		        open position (or lower than the prevailing when applying the stop loss to an existing open position). It can be used\r\n		        to help protect against losses.\r\n		    </p>\r\n\r\n		    <p>\r\n		        E.g. If our quote for Australian 200 CFD is 5100 / 5106\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>To close a position using a stop loss:</strong><br />\r\n		        If you were long in the market and wished your position to be closed if the market went beneath 5000, then you would\r\n		        leave a Stop Loss Order linked to that position to Sell at 5000. If the price fell to 5000 (or lower) then the Stop\r\n		        would be executed and close that position.\r\n		    </p>', '<p>\r\n		       Una orden de detención de pérdida es una instrucción para comprar o vender un mercado un precio más bajo que el de apertura (o aun más bajo que el que prevalece cuando se aplican las ordenes de detención de pérdidas en una posición abierta existente). Pueden ser usadas como ayuda y protección contra las pérdidas.\r\n		    </p>\r\n\r\n		    <p>\r\n		       Por ejemplo si nuestro presupuesto de Australia 200 CFD es 5100/5106\r\n		    </p>\r\n\r\n		    <p>\r\n		        <strong>Para cerrar una posición usando una orden de detención de pérdidas:</strong><br />\r\n		       Si usted estaba en una posición extensa en el mercado y deseaba que su posición se cerrara si el mercado iba bajo 5000, entonces usted dejaría una orden de detención de pérdidas vinculada a su posición para vender a 5000. Si el precio baja a 5000 (o menos) entonces la detención deberá ser ejecutada y se cerrará la posición.\r\n		    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-11 14:48:16', '2019-02-11 14:48:21'),
	(4069, 'FXRESOURCES_CFD_PLATFORMS', 'TEXT', '["0"]', '<strong>Open a demo trading account now!</strong> You can <strong>choose</strong> from these four amazing trading platforms:', '<strong>¡Abra una cuenta real ahora!</strong> Puede <strong> seleccionar</strong> entre nuestras cuatro asombrosas plataformas:', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-13 15:49:14', '2019-02-13 15:49:22');
