	(20, '/about', 'about_us', 'about', 'us', NULL, 'page', NULL, NULL, 'pages/about/us', 'underdev', 'en', '<p class="text-center text-muted font-weight-light">Tradeview provide unmatched online trading solutions to a broad range of traders investors around the world. We are more than a just a brokerage.</p>', 'About Us', 'Tradeview was established in 2004 with a vision: To provide unmatched online trading solutions to a broad range of traders and investors in the world.', NULL, 'INDEX,FOLLOW', NULL, NULL, NULL, NULL, NULL, NULL, 'weekly', '0.5', NULL, '2018-11-21 15:54:49', '2018-11-21 15:54:51'),
	(21, '/about/team', 'tradeview-team', 'about', 'team', NULL, 'page', NULL, NULL, 'pages/about/team', 'underdev', 'en', '<p class="text-center text-muted font-weight-light">We are proud of how we do business, which we believe constantly creates raving fan customers and culture.</p><h5 class="text-right">Tim Furey</h5>', 'Team', 'Tradeview is proud of how we do business. We take our clients trading very seriously. We ask ourselves everyday on how Tradeview can add more value.', NULL, 'INDEX,FOLLOW', NULL, NULL, NULL, NULL, NULL, NULL, 'weekly', '0.5', NULL, '2018-11-21 15:54:49', '2018-11-21 15:54:51'),
	(22, '/about/why', 'why-tradeview', 'about', 'why', NULL, 'page', NULL, NULL, 'pages/about/why', 'underdev', 'en', '<p class="text-center text-muted font-weight-light">We have been recognized as one of the fastest growing Forex Brokers with a focus on customer service and lightening fast execution.</p>', 'Why do People Choose us?', 'We have been recognized as one of the fastest growing Forex Brokers with a focus on customer service and lightening fast execution.', 'Forex Trading, investors, leverage, fx trading, investment objectives, foreign exchange, exchange,exchange-traded, futures, options', 'INDEX,FOLLOW', NULL, NULL, NULL, NULL, NULL, NULL, 'weekly', '0.5', NULL, '2018-11-21 15:54:49', '2018-11-21 15:54:51'),
	(23, '/about/funds-safety', 'funds-safety', 'about', 'funds_safety', NULL, 'page', NULL, NULL, 'pages/about/funds', 'underdev', 'en', '<p class="text-center text-muted font-weight-light">There are seven excellent reasons why our clients experience paramount safety and ease of mind when transacting with Tradeview.</p>', 'Funds Safety', 'Tradeview provides professional accounting, consulting and administrative services for hedge funds, fund of funds, CTAs, CPOs and other accounts.', NULL, 'INDEX,FOLLOW', NULL, NULL, NULL, NULL, NULL, NULL, 'weekly', '0.5', NULL, '2018-11-21 15:54:49', '2018-11-21 15:54:51'),
	(24, '/about/careers', 'careers', 'about', 'careers', NULL, 'page', NULL, NULL, 'pages/about/careers', 'underdev', 'en', '<p class="text-center text-muted font-weight-light"> <strong>Tradeview Forex</strong> is an equal opportunity employer, which is looking for energetic Forex or CFD sales people with at least 2 years of experience and knowledge of Forex or CFD products, markets, MT4, cTrader and Currenex.</p>', 'Careers', 'We are looking for energetic Forex or CFD sales people with at least 2 years of experience and knowledge of Forex or CFD products.', NULL, 'INDEX,FOLLOW', NULL, NULL, NULL, NULL, NULL, NULL, 'weekly', '0.5', NULL, '2018-11-21 15:54:49', '2018-11-21 15:54:51'),
